import styled from 'styled-components';

const Layout = styled.div`
  width: 100vw;
  height: 100vh;
  background: lightgray;

  display: grid;
  grid-template-rows: 250px 1fr 200px;
`;

const Home = () => {
  return (
    <Layout>
      <h1>Header</h1>
      <h1>Welcome home</h1>
      <h1>Footer</h1>
    </Layout>
  );
};

export default Home;
